import React from 'react';


class Home extends React.Component {
  render(){
      return (
      <div >
         <form >
            <input type="text" placeholder="Search" className="mr-sm-2" />
            <button variant="outline-success">Search</button>
        </form>
         
      </div>
    );
  }
}

export default Home;
